import React from "react";
import * as myProjectService from "../services/myProjectService";
import {
  // Card,
  // CardHeader,
  // CardBody,
  CardTitle,
  // CardFooter,
  Row,
  Col
} from "reactstrap";
// import Icons from "../views/Icons/Icons";

// import ProfileCard from "../components/ProfileCard";
// import CardAuthor from "components/CardElements/CardAuthor.jsx";
// import FormInputs from "components/FormInputs/FormInputs.jsx";
import Button from "components/CustomButton/CustomButton.jsx";

class Register extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      myProject: []
      // firstName: "",
      // lastName: "",
      // certifications: "",
      // specializations: "",
      // yogaStyle: "",
      // bio: "",
      // rates: "",
      // location: "",
      // website: "",
      // email: "",
      // phone: "",
      // image: ""
      // yoga: {}
    };
  }

  componentDidMount() {
    debugger;

    let newState = this.props.location.state;

    // If (!this.state.)
    this.setState({ myProject: newState.myProject });
    // this.setState({ firstName: newState.firstName });
    console.log(this.state.firstName);
  }
  handleChange = e => {
    debugger;
    this.setState({
      [e.target.name]: e.target.value
    });
  };

  onSubmit = e => {
    e.preventDefault();
    // console.log(values);
    debugger;
    const payload = {
      myProject: this.state.myProject
      // firstName: this.state.firstName,
      // lastName: this.state.lastName,
      // certifications: this.state.certifications,
      // specializations: this.state.specializations,
      // yogaStyle: this.state.yogaStyle,
      // bio: this.state.bio,
      // rates: this.state.rates,
      // location: this.state.location,
      // image: this.state.image,
      // website: this.state.website,
      // email: this.state.email,
      // phone: this.state.phone
    };

    myProjectService
      .submitProfile(payload)
      .then(this.onSuccess)
      .catch(this.onError);
  };

  onSuccess = payload => {
    debugger;
    console.log("successful ya", payload);
    this.props.history.push("/user-page/");
    console.log(this.props);
    // const id = e.target.id;
    // this.props.history.push("/icons/" + id);
    // console.log(this.props.match.params.id);
  };

  onError = () => {
    debugger;
    console.log("boo boo");
  };

  render() {
    // <Icons data={this.state} />;
    const yogi = this.state.myProject;

    return (
      <React.Fragment>
        <div className="content">
          {/* <br />
        <br />
        <br /> */}
          <Row>
            <Col xs={2} />
            <Col xs={8}>
              {/* <Col xs={8}> */}
              <div className="content-wrapper">
                <div className="content-heading" />
                <div className="row">
                  <div className="col-xl-12">
                    <div className="card card-default">
                      <div className="card-body">
                        {/* Flat make resvervation */}
                        <section className="flat-row contact-2">
                          <div className="container">
                            <div className="row">
                              <div className="col-md-12">
                                <div className="reservation-page-right">
                                  {/* <img
                              // src="https://images.pexels.com/photos/395198/pexels-photo-395198.jpeg?auto=compress&cs=tinysrgb&dpr=2&h=750&w=1260"
                              // src="https://www.yogatoday.com/files/images/uploads/made/files/images/uploads/poses/PD073AA_White_Steph_Warrior2_018Q5353_WEB_1300_725_s_c1.jpg"
                              className="img-responsive"
                              alt="reservation-banner"
                            /> */}
                                </div>
                              </div>
                              {/*col-md-5*/}
                              <div className="col-md-12">
                                <div className="reservation-page-center">
                                  <div className="reservation-page-form">
                                    <div className="title-section">
                                      {/* <h1 className="title">Register</h1> */}
                                      <CardTitle className="title text-center">
                                        <h3>Register</h3>
                                      </CardTitle>
                                    </div>
                                    <form
                                      id="reservation-form"
                                      action="contact/contact-process.php"
                                      noValidate="novalidate"
                                    >
                                      <div className="reservation-page-input-box">
                                        <label>First Name</label>
                                        <input
                                          type="text"
                                          className="form-control"
                                          placeholder="First Name"
                                          name="firstName"
                                          id="form-firstName"
                                          data-error="Subject field is required"
                                          required
                                          value={yogi.firstName}
                                          // value={this.state.firstName}
                                          onChange={e => this.handleChange(e)}
                                        />
                                      </div>
                                      <div className="reservation-page-input-box">
                                        <label>Last Name</label>
                                        <input
                                          type="text"
                                          className="form-control"
                                          placeholder="Last Name"
                                          name="lastName"
                                          id="form-lastName"
                                          data-error="Subject field is required"
                                          required
                                          value={this.state.lastName}
                                          onChange={e => this.handleChange(e)}
                                        />
                                      </div>
                                      <div className="reservation-page-input-box">
                                        <label>Certifications</label>
                                        <input
                                          type="email"
                                          className="form-control"
                                          placeholder="Enter your certifications"
                                          name="certifications"
                                          id="form-certifications"
                                          data-error="Subject field is required"
                                          required
                                          value={this.state.certifications}
                                          onChange={e => this.handleChange(e)}
